import React from 'react';
import { Route, Switch  } from "react-router-dom";
import './App.css';
import Header from './components/common/Header';
import Footer from './components/common/Footer';
import PageNotFound from './components/PageNotFound';
import ClassesForm from './components/classes/ClassesForm';
import ClassesList from './components/classes/ClassesList';


function App({match}) {
  return (
    <div>
      <Header />
      <Switch>
        <Route exact path="/" component={ClassesList} /> 
        {/* <Route exact path="/ClassesList/:id" component={ClassesList} />  */}

        <Route path="/classesform" component={ClassesForm} />

        {/* <Route path="/classesform" component={ClassesForm} /> */}


        <Route path="/classesform/:id" render={
          ({ match }) => <ClassesForm match={match} />
        } />

        <Route component={PageNotFound} />
      </Switch>
      <Footer />
    </div>
  );
}

export default App;
